import React from "react";

const footer = () => {
  return (
    <div className="d-flex p-5  justify-content-around  color-v">
      <div>
        <h3>Find location</h3>
      </div>
      <div>
        <h3>Contact</h3>
      </div>
      <div>
        <h3>Follow us</h3>
      </div>
      <div>
        <h3>Download App</h3>
      </div>
    </div>
  );
};

export default footer;
